import React from "react";

import { Paper, Chip, TextField } from "@mui/material";
import AccountBoxIcon from "@mui/icons-material/AccountBox";

const ViewEmployee = () => {
  return (
    <div>
      <Paper elevation={3} style={{ padding: "10px" }}>
        <Chip
          label="View Profile"
          color="primary"
          variant="outlined"
          icon={<AccountBoxIcon />}
        />

        <br />
        <p>
          <TextField
            color="primary"
            variant="outlined"
            InputProps={{ readOnly: true }}
            fullWidth
            size="small"
            label="First Name"
          />
        </p>
        <p>
          <TextField
            color="primary"
            variant="outlined"
            InputProps={{ readOnly: true }}
            fullWidth
            size="small"
            label="First Name"
          />
        </p>
      </Paper>
    </div>
  );
};

export default ViewEmployee;
